  false,\n\t\"url\": null,\n\t\"notes\": \"The grid of isostatic residual gravity
  anomaly data was produced from the grid of Bouguer gravity anomaly data (see Bouguer
  gravity metadata) by using an Airy-Heiskanen compensation model with three parameters.
  The depth to the compensating root at sea level was chosen to be 30 km. The density
  contrast across the root was chosen to be 0.35 grams per cubic centimeter, and the
  the density of the topography was chosen to be 2.67 grams per cubic centimeter.\",\n\t\"license_title\":
